    <style>
@page {
  size: A4 portrait;
  margin: 5mm;
}

body {
  margin: 0;
  padding: 0;
  font-family: Arial, sans-serif;
}

.page {
  display: grid;
  grid-template-columns: repeat(3, 60mm); /* 3 columns of 60mm */
  grid-template-rows: repeat(4, 60mm); /* 4 rows of 60mm */
  gap: 0; /* No gaps for perfect alignment */

  width: 180mm; /* 3 cards * 60mm */
  height: 240mm; /* 4 cards * 60mm */

  margin: 0 auto; /* Center the grid on the page */
  justify-content: center;
  align-content: center;
  page-break-inside: avoid;

  border: 0.5pt dashed red; /* Debugging: Remove when done */
}

.card {
  position: relative;
  width: 60mm;
  height: 60mm;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  box-sizing: border-box;
}

.front {
  text-align: center;
  background: hsl(210, 50%, 90%);
}

.front .artist {
  font-size: 1.2em;
  font-weight: bold;
  margin-top: 2mm;
}

.front .year {
  font-size: 3.5em;
  font-weight: bold;
  margin: auto 0;
}

.front .song-name {
  font-size: 1em;
  margin-bottom: 2.5mm;
}

.front .serial-number {
  position: absolute;
  bottom: 1mm;
  left: 1mm;
  font-size: 0.5em;
  color: #333;
}
